import "../style/About.css";

export default function About() {
  return <Details />;
}
function Details() {
  return (
    <div className="shop-about">
      <img src="https://images.unsplash.com/photo-1507914372368-b2b085b925a1?q=80&w=2940&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D" />
    </div>
  );
}
